PREFIX  xsd:  <http://www.w3.org/2001/XMLSchema#>
PREFIX  rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX  rdf:  <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX  dbprop: <http://dbpedia.org/property/>

SELECT  *
WHERE
  { { { <http://www.yso.fi/kulttuuriSampo/paikat#leiden>
                  rdfs:label    ?cities2 ;
                  dbprop:latd   ?latd ;
                  dbprop:latm   ?latm ;
                  dbprop:lats   ?lats ;
                  dbprop:longd  ?longd ;
                  dbprop:longm  ?longm ;
                  dbprop:longs  ?longs
        BIND(( ( ( ?latd / 1.0 ) + ( ?latm / 60.0 ) ) + ( ?lats / 3600.0 ) ) AS ?latitude)
      }
      BIND(( ( ( ?longd / 1.0 ) + ( ?longm / 60.0 ) ) + ( ?longs / 3600.0 ) ) AS ?longitude)
    }
    VALUES ?cities2 { "Kuopio"@en "Vantaa"@en }
  }

PREFIX  dbpo: <http://dbpedia.org/ontology/>
PREFIX  rdf:  <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX  dbpr: <http://dbpedia.org/resource/>
PREFIX  foaf: <http://xmlns.com/foaf/0.1/>

SELECT  *
WHERE
  { <http://dbpedia.org/resource/Small_Faces_%28film%29>
              rdf:type              dbpo:Film ;
              foaf:isPrimaryTopicOf  ?wikiPage ;
              dbpo:runtime          ?runtime ;
              dbpo:releaseDate      ?release
  }

