PREFIX  dbpo: <http://dbpedia.org/ontology/>
PREFIX  gsp:  <http://www.opengis.net/ont/geosparql#>
PREFIX  dbpr: <http://dbpedia.org/resource/>

SELECT  ?lat ?long ?country0 ?lat0 ?long0 ?country1 ?lat1 ?long1 ?country2 ?lat2 ?long2 ?country3 ?lat3 ?long3 ?country4 ?lat4 ?long4 ?country5 ?lat5 ?long5 ?country6 ?lat6 ?long6
WHERE
  { dbpr:Malawi  gsp:lat    ?lat ;
              gsp:long      ?long .
    dbpr:Geneva  dbpo:country  ?country2 ;
              gsp:lat       ?lat2 ;
              gsp:long      ?long2 .
    dbpr:Lilongwe
              dbpo:country  ?country3 ;
              gsp:lat       ?lat3 ;
              gsp:long      ?long3 .
    dbpr:Chikwawa
              dbpo:country  ?country4 ;
              gsp:lat       ?lat4 ;
              gsp:long      ?long4 .
    dbpr:Mwanza  dbpo:country  ?country5 ;
              gsp:lat       ?lat5 ;
              gsp:long      ?long5
  }

