PREFIX  rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX  xmls: <http://www.w3.org/2001/XMLSchema#>
PREFIX  rdf:  <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX  dbprop: <http://dbpedia.org/property/>

SELECT DISTINCT  ?cityname ?latd ?latm ?lats ?convertedLat ?longd ?longm ?longs
WHERE
  { VALUES ?cityname { "Kuopio"@en "Vantaa"@en }
    ?cityRes  rdfs:label    ?cityname ;
              dbprop:latd   ?latd ;
              dbprop:latm   ?latm ;
              dbprop:lats   ?lats ;
              dbprop:longd  ?longd ;
              dbprop:longm  ?longm ;
              dbprop:longs  ?longs
    BIND(( ( <www.w3.org/2001/XMLSchema#float>(?latd) + <www.w3.org/2001/XMLSchema#float>(( ?latm / 60.0 )) ) + <www.w3.org/2001/XMLSchema#float>(( ?latm / 3600.0 )) ) AS ?convertedLat)
  }

