        dbpo:birthPlace     dbpr:London ;
        dbprop:dateOfBirth  ?d ;
        dbpo:position       dbpr:Midfielder ;
        dbprop:clubs        <http://dbpedia.org/resource/Manchester_United_F.C.>
  }
